function playDrum(seed) {
	const sampleMap = [
		'tom',
		'kick',
		'snare',
		'clap',
		'cowbell',
		'crash',
		'hihat',
		'openhat',
		'perc',
		'shaker',
	]
	const rand = Math.sin((seed + 1) * 12.9898) * 43758.5453;
	sampleType = sampleMap[seed % sampleMap.length];
	s = window.samplesByType[sampleType];
	sample = s[seed % s.length];

	const source = audioContext.createBufferSource();
	source.buffer = audioBuffer;
	source.connect(audioContext.destination);
	source.start(0, sample.start_time, sample.duration);
}

function primeNotes(ind, state) {
	Array.from(document.getElementsByClassName(`note ${ind}`)).forEach((e, i, a) => {
		if (state) {
			e.classList.add('primed');
			if (e.classList.contains('active')) {
				e.classList.add('playing');
				playDrum(i);
			}
		} else {
			e.classList.remove('playing');
			e.classList.remove('primed');
		}
	}
	)
}
// go back to index.html
function goBack() {
	window.location.href = 'index.html';
}



function updateStep() {
	// get furthest note 
	let maxNote = 0;
	Array.from(document.getElementsByClassName('note active')).forEach((e, i, a) => {
		let ind = parseInt(e.getAttribute('note'));
		if (ind > maxNote) {
			maxNote = ind;
		}
	});
	// re-set pattern length
	window.pattern_len = 4;
	while (window.pattern_len <= maxNote || (window.pattern_len % 4 != 0)) {
		window.pattern_len++;
	}
	if (++window.step >= window.pattern_len) window.step = 0;
}

function advanceNotes() {
	if (!window.isPlaying) return;
	primeNotes(window.step, 0);
	updateStep();
	primeNotes(window.step, 1);
	setTimeout(advanceNotes, 60000 / window.bpm);
}

function togglePlayback() {
	if (window.isPlaying) {
		window.isPlaying = false;
	} else {
		window.isPlaying = true;
		advanceNotes();
	}
}

function meClicked(e, x) {
	e.target.innerHTML = (window.isPlaying ? "Play" : "Pause");
	togglePlayback();
}

function clicked(e, y, x) {
	const span = e.target;
	if (span.classList.contains('active')) {
		span.classList.remove('active');
		return;
	}
	span.classList.add('active');
	playDrum(y);
}

function handleKey(e) {
	e.preventDefault();
	if (e.key === ' ') {
		togglePlayback();
	}
}

function setBpm() {
	window.bpm = parseInt(this.value);
	console.log("set bpm to", window.bpm);
}

function clickSummary(e) {
	e.preventDefault();
	var notes = document.getElementsByClassName('note');
	for (let item of notes) {
		item.classList.remove('active')
	}
}

function modifyPage() {
   // Add Back button
   const backBtn = document.createElement('button');
   backBtn.textContent = '←';
   backBtn.onclick = goBack;
   backBtn.style.position = 'fixed';
   backBtn.style.top = '10px';
   backBtn.style.left = '10px';
   backBtn.style.zIndex = 1000;
   document.body.appendChild(backBtn);

	if (window.bpm) return;
	drumsInit();
	window.bpm = 160;
	window.step = 0;
	window.pattern_len = 4;
	window.note_length = 0.4;
	// Add CSS styles
	const style = document.createElement('style');
	style.textContent = `
		a.text-line:active {
			color: blue;
			text-decoration: underline;
		}
		.note {
			display: inline-block;
			width: .6em;
			font-family: monospace;
			font-style: normal;
		}
		.note.primed {
			border: 1px dashed #333;
			background-color: lightgrey;
			padding: 0px 1px;
		}
		.note.active {
			background-color: lightblue;
			color: white;
		}
		.note.playing {
			background-color: red;
			color: white;
		}
		.note:hover {
			background-color: yellow;
			color: black;
		}
	`;
	document.head.appendChild(style);
	nodes = document.querySelectorAll('ol>li>a');
	summary = document.querySelectorAll('details>summary')[0];
	summary.addEventListener('click', clickSummary, true);
	summary.innerText = "Clear Notes";
	var selectElement = document.getElementById('sort-select');
	// Clear all existing options
	// Remove event listener
	var se2 = selectElement.cloneNode(true);
	selectElement.replaceWith(se2);
	se2.innerHTML = '';
	var newOptions = [80, 100, 120, 140, 160, 180, 200, 220, 240, 260, 280, 300];
	newOptions.forEach(function (option) {
		var newOption = document.createElement('option');
		newOption.value = option;
		newOption.textContent = `${option} bpm`;
		if (option == 160) newOption.selected = true;
		se2.appendChild(newOption);
	});
	se2.onchange = setBpm;
	let meFound = 0;
	nodes.forEach((i, ind) => {
		if (i.href.startsWith("javascript")) {
			i.setAttribute("onClick", `javascript: meClicked(event, ${ind});`);
			i.innerText = 'Pause';
			meFound = 1;
		} else {
			// Wrap each character in a span
			const text = i.textContent;
			i.innerHTML = '';
			let ii = 0;
			for (let char of text) {
				const span = document.createElement('span');
				span.textContent = char;
				if (char === ' ') span.textContent = ' ';
				if (ii == 0) {
					span.classList.add('primed');
				}
				span.setAttribute("onClick", `javascript: clicked(event, ${ind - meFound}, ${ii});`);
				span.classList.add('note');
				span.classList.add(`${ii}`);
				span.setAttribute('note', ii);
				ii++;
				i.appendChild(span);
			}
			i.classList.add('text-line');
			i.href = "javascript:;";
		}
	});
	window.addEventListener("keypress", handleKey);
	notes = document.getElementsByClassName('note');
	window.isPlaying = true;
	primeNotes(0, 1);
	setTimeout(advanceNotes, 60000 / window.bpm);
}
